import 'bootstrap/dist/css/bootstrap.min.css';
import Button from 'react-bootstrap/Button';
import React from 'react';


function App() {
    return (
      <div className="App">
        <Button variant="outline-primary">Primary</Button>
        <p>Trinamool Congress leader Mahua Moitra who was expelled from Lok Sabha last month due to 
          alleged unethical conduct, vacated her government bungalow in Delhi at 10 am today, January 19, Friday.</p>


      </div>
    );
  }
  export default App;
